// import axios from 'axios';
import {
    SET_MESSAGEIS_READ
} from './types';

export const setMessageIsRead = (data) => {
    let receivedData = [data];
    console.log("action receive data", receivedData[0].read);
    return ({
        type: SET_MESSAGEIS_READ,
        payload: data,
    })
}
